import React from 'react'
import HomeIcon from '@material-ui/icons/Home';
import ExploreIcon from '@material-ui/icons/Explore';
import PersonIcon from '@material-ui/icons/Person';
import AddCircleIcon from '@material-ui/icons/AddCircle';
import { grey } from '@material-ui/core/colors';

const StickyMenu = () => {
  return (
    <nav className="sticky-menu">
      <HomeIcon fontSize="large" style={{ color: grey[50] }}/>
      <ExploreIcon fontSize="large" style={{ color: grey[50] }}/>
      <PersonIcon fontSize="large" style={{ color: grey[50] }}/>
      <AddCircleIcon fontSize="large" style={{ color: grey[50] }}/>
    </nav>
  )
}

export default StickyMenu
